    }
    constructor(todos) {
        makeObservable(this, {
            todos: observable,
            unfinishedTodoCount: computed
        })
        this.todos = todos
    }
}*/

class Grid {
    squares = [];

    constructor() {
        makeAutoObservable(this);
        this.initializeGrid();
    }

    get getGrid() {
        return this.squares;
    }

    set initializeGrid(size = 10) {
        for (let i = 0; i < size; i++) {
            this.squares.push([])
            for (let j = 0; j < size; j++) {
                this.squares[i].push(createSquare());
            }
        }
    }
}
